'''Pinball''' is a [[Random events|random event]] where the player is transported by [[Flippa]] to a strange room with five pillars, each with one [[Runes|rune]] on top, and two [[troll]]s, [[Tilt]] and Flippa, wielding large clubs.

The goal of the game is to tag each pillar that has glowing rings around it. This scores the player one point. After the player has scored ten points, they are free to leave through the exit. If a pillar that doesn't have the glowing rings around it is tagged, the score is reset to zero, and the player has to try again. The five pillars contain five spinning tops with [[Fire rune|fire]], [[Water rune|water]], [[Earth rune|earth]], [[Air rune|air]], and [[nature rune]]s respectively.

Following an update on [[Update:The_Portal_Nexus|8 November 2018]], players may now leave the random event at any time by clicking the exit. Prior to this change if the player tried to leave before reaching ten points, they would be [[Teleportation|teleported]] in front of Tilt and Flippa, who knocked the player back onto the pillars and reset the score. 

